import XCTest
@testable import ApiClientIOS

final class BiometricVerificationApiIntegratedTest: XCTestCase {

    let aux = DocumentQueryAPI()
    let sut = BiometricVerificationAPI()
    
    func testComunicationForApi() throws {
        try XCTSkipIf(!ConstantsTest().activeIntegrationTest)
        let asyncExpectation = expectation(description: "BiometricWorkingFunction")

        aux.DocumentQuery(documentType: .foreigner, documentNumber: "1061776566", bearerSSO: "*") { response, err in
            if let res = response {
                var biometricRequest = BiometricVerificationRequest()
                biometricRequest.finger = .rightIndex
                biometricRequest.fingerPrint = ""
                self.sut.BiometricVerificationPost(biometricVerificationRequest: biometricRequest, token: res.token, completion: { response, err in
                    asyncExpectation.fulfill()
                })
            }
        }
        
        self.waitForExpectations(timeout: 60) { error in
            XCTAssertNil(error)
        }
    }
}
